import React, { useState} from 'react';
//import Data from "./Data"
import ReactDOM from "react-dom";

class App extends React.Component{
	constructor(){
		super()
		this.state={
			name:'aakash bandhu aryal',
			pae:'bhairahawa'
			
		}
		
	}
	
	
	render(){
		return(
		<>
		<h1>{this.state.name}</h1>
		<h2>{this.state.pae}</h2>
		</>
				)

		
	}
	
	
	
	
	
}



export default App;
